import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Question(props) {

    const pr = props;
    const question = props.getquestionid(pr.id);
    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{props.id}</p>
            <p>{question.title}</p>
        </Paper>
    )
}
